INSERT INTO public.recipe (id,user_id,name,cook_time,prep_time,servings,course_type,recipe_type,instructions,image) VALUES
	 ('7906e62c-6b60-4539-bbc5-4703712e7717','nTTg2ouQmCXUStTF98rItVPfr8Ea8Xad','Spaghetti Carabonara',15,10,4,'MAIN_COURSE'::public.course_type,'DINNER'::public.recipe_type,'Bring a large pot of salted water to a boil. Cook spaghetti until al dente. While pasta cooks, cut guanciale into small strips and fry in a pan over medium heat until crispy and golden. Remove from heat. In a bowl, whisk together egg yolks, whole egg, grated Pecorino Romano, and freshly cracked black pepper until creamy. Reserve about 1 cup of pasta cooking water, then drain spaghetti. Quickly toss the hot pasta with guanciale and its rendered fat. Remove pan from direct heat, then pour in the egg-cheese mixture, tossing rapidly to create a silky sauce. Add small splashes of reserved pasta water if needed for creaminess.Serve immediately, topped with extra Pecorino Romano and black pepper.','data:image/jpeg;base64,'),
	 ('e2d61dbb-a92a-4db7-a9e2-18de848468be','nTTg2ouQmCXUStTF98rItVPfr8Ea8Xad','Unami Bomb Burger',15,20,1,'MAIN_COURSE'::public.course_type,'LUNCH'::public.recipe_type,'In a skillet, saut chopped shiitake mushrooms in butter until golden and reduced, intensifying their umami flavor. Set aside. Mix ground beef with soy sauce, Worcestershire sauce, garlic powder, onion powder, salt, and pepper. Form into 4 patties. Grill or pan-sear patties over medium-high heat until cooked to desired doneness. Top each patty with sauted shiitake mushrooms and a slice of sharp cheddar cheese. Cover briefly so cheese melts. Toast brioche buns lightly for added flavor and structure. Spread truffle aioli on the bottom bun, then layer arugula, the umami-packed patty with mushrooms and cheese, caramelized onions, and pickled red onions. Crown with the top bun and serve hot.','data:image/jpeg;base64,'),
	 ('6bce1e36-cb5b-49d9-8360-6c2ed1e1d287','nTTg2ouQmCXUStTF98rItVPfr8Ea8Xad','Perfect Scrambled Eggs',5,5,2,'MAIN_COURSE'::public.course_type,'BREAKFAST'::public.recipe_type,'Crack the eggs into a bowl, add milk or cream, a pinch of salt, and whisk until smooth and slightly frothy. Heat a non-stick skillet over low to medium-low heat. Add butter and let it melt gently. Pour in the egg mixture. Allow it to sit undisturbed for a few seconds, then stir slowly with a spatula. Continue to gently push the eggs from the edges toward the center, forming soft curds. Cook until eggs are creamy and slightly underdone (they will continue cooking off-heat). Remove from the pan immediately, season with pepper, and garnish with chives if desired.','data:image/jpeg;base64,'),
	 ('ec6ff23c-d136-46ef-884f-334b162ef233','nTTg2ouQmCXUStTF98rItVPfr8Ea8Xad','Beef Wellington',6,40,45,'MAIN_COURSE'::public.course_type,'DINNER'::public.recipe_type,'Season beef tenderloin generously with salt and pepper. Heat olive oil in a pan and sear beef on all sides until browned. Remove and brush with mustard. Let cool. In the same pan, saut mushrooms, shallots, butter, and thyme over medium heat until moisture evaporates and mixture becomes a dry mushroom duxelles. Cool completely. Lay out plastic wrap, arrange prosciutto slices slightly overlapping, then spread mushroom duxelles evenly on top. Place beef on the mushroom-covered prosciutto and roll tightly using the plastic wrap. Chill for 1520 minutes to set shape. Roll out puff pastry into a rectangle large enough to enclose the beef. Unwrap beef from plastic and place on pastry. Wrap tightly, sealing edges, and trim excess pastry. Brush pastry with egg yolk wash. Optionally score the pastry lightly with a knife for decoration. Chill again for 10 minutes. Bake in a preheated oven at 200C (390F) for 4045 minutes, until pastry is golden brown and internal beef temperature reaches about 50C (120F) for medium-rare. Rest for 10 minutes before slicing thick portions and serving.','data:image/webp;base64,');
